from collections import deque

def jumpGameVI(nums):
    n = len(nums)
    q = deque([(0, 0, nums[0])])  # (index, jump, value)
    res = [[float('inf'), float('inf')]]
    while q:
        i, jump, val = q.popleft()
        if res[0][0] < val:
            res = [[val, jump]]
        elif res[0][0] == val:
            res[0][1] = min(res[0][1], jump)
        if i + nums[i] >= n - 1:
            res[0][0] = min(res[0][0], val)
            res[0][1] = min(res[0][1], jump)
        for j in range(i + 1, min(i + nums[i] + 1, n)):
            q.append((j, jump + 1, val + nums[j]))
    return res[0]
